import { Redirect, Route as ReactDOMRoute } from "react-router-dom";

interface IRouteProps {
  isPrivate?: boolean;
  component: () => JSX.Element;
  path: string;
  exact?: boolean;
}

const Route = ({ component: Component, path }: IRouteProps) => {
  return (
    <ReactDOMRoute
      render={() => {
        return <Component />;
      }}
    />
  );
};

export default Route;
